import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

function PdfList() {
  const [pdfs, setPdfs] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8080/api/pdfs')  // API to fetch the list of PDFs
      .then(response => setPdfs(response.data))
      .catch(error => console.log(error));
  }, []);

  return (
    <div>
      <h2>Uploaded PDFs</h2>
      <ul>
        {pdfs.map(pdf => (
          <li key={pdf.id}>
            <Link to={`/pdf/${pdf.id}`}>{pdf.name}</Link>
          </li>
        ))}
      </ul>
      <Link to="/upload">
        <button>Add New File</button>
      </Link>
    </div>
  );
}

export default PdfList;
